import React from 'react'
import data from '../businesses.json'

export default function BusinessMap() {

    const tagSperator = (arr) => {
        arr.split(' ')
    }


    const map = data.map((business) => {
        return (
                    <li key={business.distance} className="list">
                        <div className="side-card">
                            <h5>
                                {business.name}
                            </h5>
                            <p>
                                {business.address}
                            </p>    
                            <span>{tagSeperator(business.businessType)}</span>
                        </div>
                    </li>
            )
        }
    )

    return (
        <ul className ="list-ul">
            {map}
        </ul>
    )
}
